export const retrieveAFlightById = (id) => urlAPI.get(`/flights/${id}`)

export const DeleteFlightById = (id) => urlAPI.delete(`/flights/${id}`)

export const AddNewFlight =(Flight) => urlAPI.post(`/flights/add`,Flight)

